import React from 'react';

export default function RightSidebar({ models, onSelectModel }) {
  return (
    <div>
      <h3>All Models</h3>
      {models.length > 0 ? (
        models.map((model) => (
          <div
            key={model.id}
            onClick={() => onSelectModel(model)}
            style={{
              cursor: 'pointer',
              marginBottom: '0.5rem',
              padding: '0.5rem',
              background: '#024731',
              color: '#ccc',
              border: '1px solid #666',
            }}
          >
            {model.name}
          </div>
        ))
      ) : (
        <p style={{ color: '#ccc' }}>No models loaded.</p>
      )}
    </div>
  );
}
